export default (function(a,b,c,d,e,f,g){return {data:{"9EdY7FwJjp":{data:[{id:2745,attributes:{type:e,item_lang:{data:{id:3412,attributes:{title:"House of the Dragon",slug:"house-of-the-dragon"}}}}},{id:2747,attributes:{type:b,item_lang:{data:{id:3414,attributes:{title:"Bullet Train",slug:"bullet-train"}}}}},{id:2752,attributes:{type:b,item_lang:{data:{id:3419,attributes:{title:"White Noise",slug:"white-noise"}}}}},{id:2765,attributes:{type:b,item_lang:{data:{id:3432,attributes:{title:"Argylle",slug:"argylle"}}}}},{id:2772,attributes:{type:e,item_lang:{data:{id:3439,attributes:{title:"Super Pumped",slug:"super-pumped"}}}}}],meta:{pagination:{page:f,pageSize:25,pageCount:f,total:5}}},SVK3qwdsGa:{data:{id:872,attributes:{imdbId:"tt0118998",poster:"https:\u002F\u002Fm.media-amazon.com\u002Fimages\u002FM\u002FMV5BNGVmYjI4ZjktMjVkNi00ZTRlLWJlYTMtNzMxYjQ0ZDIyZWNmXkEyXkFqcGdeQXVyNTUyMzE4Mzg@._V1_SX300.jpg",type:b,ratings:[{Source:"Internet Movie Database",Value:"5.4\u002F10"},{Source:"Rotten Tomatoes",Value:"42%"},{Source:"Metacritic",Value:"46\u002F100"}],item_lang:{data:{id:1535,attributes:{title:"Doctor Dolittle",plot:"Dr. John Dolittle has the world in his hands: A beautiful wife at his side, two adorable daughters and a career that could not go better. One night, he nearly runs over a dog with his car. The dog yells \"bonehead\" and disappears. From then on, his childhood ability is back: To communicate with animals. Unfortunately, the word of Dolittle's ability is spreading quickly. Soon, many animals from rat to horse flock to his place to get medical advice. But his colleagues suspect he's going mad, and as the clinic Dolittle used to work for is about to being taken over for a huge amount of money, many decisions have to be made. Believe him? Put him into a mental institution? Sell the clinic? But also his family is close to breaking apart. Until a circus tiger falls seriously ill.",slug:"doctor-dolittle"}}},books:{data:[{id:5332,attributes:{title:g,description:"Designed to appeal to the booklover, the Macmillan Collector’s Library is a series of beautiful gift editions of much loved classic titles. Macmillan Collector’s Library are books to love and treasure. Doctor Dolittle is one of the most delightful and fascinating characters in children’s literature. This Macmillan Collector’s Library edition of The Story of Doctor Dolittle is illustrated with Hugh Lofting’s own drawings, and includes updated material and an afterword by author Philip Ardagh. Doctor Dolittle’s house in Puddleby-on-the-Marsh is full to the brim with eccentric characters, from Polynesia the parrot to Gub-Gub the pig. After learning the languages of all his animals, the gracious and kind-hearted doctor hears that the monkeys in Africa have become inflicted with a terrible disease. So with a team of trusty creatures by his side, the doctor sets sail on an action-packed adventure to save them.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=3cJQDwAAQBAJ&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api",authors:[a],firstBook:true,published:"2018-09-06",publisher:"Pan Macmillan",subtitle:c}},{id:5333,attributes:{title:"The Story of Doctor Dolittle (HarperCollins Children’s Classics)",description:"This beautiful HarperCollins Children’s Classics edition is perfect for every bookshelf.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=uJxGEAAAQBAJ&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api",authors:[a],firstBook:d,published:"2022-02-03",publisher:"HarperCollins UK",subtitle:c}},{id:5334,attributes:{title:g,description:"Doctor Dolittle - the only man in the world who can talk to animals. In this classic story, the Doctor sets off on an exciting adventure in Africa and returns with the most amazing creature of all - the two-headed Pushmi-Pullyu.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=YF6oPwAACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api",authors:[a,"Robin Preiss Glasser"],firstBook:d,published:"1999-01-01",publisher:"Vintage",subtitle:"Being the History of His Peculiar Life at Home and Astonishing Adventures in Foreign Parts, Never Before Printed"}},{id:5335,attributes:{title:"The Story of Dr Dolittle",description:"“After a while, with the parrot's help, the Doctor got to learn the language of the animals so well that he could talk to them himself and understand everything they said.” John Dolittle is a highly respected doctor in the village of Puddleby-on-the-Marsh, yet he loves animals so much that his house is soon full of them. With all his patients scared away, and the expense of feeding his menagerie mounting, a friend suggests that the Doctor become a vet instead. With the help of Polynesia the parrot, Doctor Dolittle swiftly learns the language of the animals so that he can talk to all of his new patients. However, when a message comes from Africa, telling of a terrible sickness among the monkeys there, the Doctor and his animal friends depart on a thrilling and dangerous adventure that they are never likely to forget.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=3WCctQEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api",authors:[a],firstBook:d,published:"2020-01-14",publisher:"Alma Classics",subtitle:c}},{id:5336,attributes:{title:"The Voyages of Doctor Dolittle",description:"Doctor Dolittle heads for the high seas in perhaps the most amazing adventure ever experienced by man or animal. Told by nine-and-a-half-year-old Tommy Stubbins, crewman and future naturalist, the voyages of Doctor Dolittle and his company lead them to Spidermonkey Island. Along with his faithful friends, Polynesia the parrot and Chee-Chee the monkey, Doctor Dolittle survives a perilous shipwreck and lands on the mysterious floating island. There he meets the wondrous Great Glass See Snail who holds the key to the greatest mystery of all.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=3e8OAAAAYAAJ&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api",authors:[a],firstBook:d,published:"1922-01-01",publisher:"Frederick A. Stokes",subtitle:c}}]}}},meta:{}}},prerenderedAt:1681377292447}}("Hugh Lofting","movie","",null,"series",1,"The Story of Doctor Dolittle"))